import React, {Component} from 'react';

class FrontPage extends Component {
  render(){
    return (
      <div>
        <div id="bg">
          <img src={require('./imgs/star_background.jpg')}/>
          <div className="title">
            <h1>Hey there</h1>
          </div>
        </div>
      </div>
     );
  }

}

export default FrontPage;
